import data from '../data';

function App() {
  return (
    <div>
      <header>
        <a href="https://reactjs.org">Vientos Kjarkas</a>
      </header>
      <main>
        <h1>Lista de Productos</h1>
        {data.products.map((product) => {
          <div>
            <img src={product.image} alt={product.name} />
          </div>;
        })}
      </main>
    </div>
  );
}

export default App;
